import React from 'react';
import Title from './Components/Title'
import Body from './Components/Body'
import { Switch,
  Route,
  Link,
  NavLink,
  Redirect,
  useParams,
  useRouteMatch } from 'react-router-dom';


function App() {
  return (
    <div>
      <Title/>
      <Body/>
    </div>
  );
}

export default App;
